import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const books = [
  {
    id: 1,
    img:
      "https://images-na.ssl-images-amazon.com/images/I/51XhQYvFvqL._AC_SX184_.jpg",
    title: "1st title",
    author: "Alemia hep",
    popularity: "hundreds",
  },
  {
    id: 3,
    img:
      "https://images-na.ssl-images-amazon.com/images/I/51XhQYvFvqL._AC_SX184_.jpg",
    title: "Harry P",
    author: "jk rowling",
    popularity: "millions of readers",
  },
  {
    id: 3,
    img:
      "https://images-na.ssl-images-amazon.com/images/I/51XhQYvFvqL._AC_SX184_.jpg",
    title: "Goosebumps",
    author: "R.L stine",
    popularity: "millions of readers",
  },
];

// CSS

function BookList() {
  return (
    <section className="booklist">
      {books.map((book) => {
        return <Book key={book.id} {...book} />;
      })}
    </section>
  );
}

const Genre = () => <h1>spooky</h1>;

const Book = ({ job, title, author, number, popularity, img }) => {
  const clickHandler = (e) => {
    alert("hello world");
    console.log(e);
  };

  const complexExample = (author) => {
    console.log(author);
  };

  return (
    <article
      className="book"
      onMouseOver={() => {
        console.log(title);
      }}
    >
      <img src={img} alt="" />
      <p>{job}</p>
      <h1 onClick={() => console.log(title)}>{title}</h1>
      <p>{number}</p>
      <p>{author}</p>
      <p>{popularity}</p>
      <button type="button" onClick={clickHandler}>
        reference example
      </button>
      <button type="button" onClick={() => complexExample(author)}>
        more complex example
      </button>

      <Genre />
      <Price />
    </article>
  );
};

const Price = () => <h2>$5</h2>;

ReactDom.render(<BookList />, document.getElementById("root"));
